  Route,
  Link
} from "react-router-dom";

const HomePage = () => {

const deneme = () => {
    console.log("tıklama başarılı");
}

return (
  <div>
     <Link to="/movies">   <Button variant="secondary" size="lg" onClick={deneme}>SERIES</Button> </Link>
     
        <p> Ppopular Series  </p>
        <Button variant="primary" onClick={deneme}>MOVIES</Button> 
        <p> Popular Movies</p>

        </div>
    
);

}

export default HomePage;
